svg.script:
function show_58d2718b(evt, text) {
	var pos = (evt.target.getAttribute("y") < 715) ? "bottom" : "top";
	var note = document.getElementById(pos + "_note_58d2718b");
	note.textContent = text;
	note.setAttributeNS(null, "visibility", "visible");
	document.getElementById(pos + "_overlay_58d2718b").setAttributeNS(null, "visibility", "visible");
}
function hide_58d2718b(evt) {
	document.getElementById("top_note_58d2718b").setAttributeNS(null, "visibility", "hidden");
	document.getElementById("top_overlay_58d2718b").setAttributeNS(null, "visibility", "hidden");
	document.getElementById("bottom_note_58d2718b").setAttributeNS(null, "visibility", "hidden");
	document.getElementById("bottom_overlay_58d2718b").setAttributeNS(null, "visibility", "hidden");
}
